const Home = () => {

    const dummy = {
    isLogged: true,
    user: 'ejonghwan',
    mainPosts: [
        { 
            user: {
                id:1,
                nickName: 'haha',
            },
            img: 'https://placeimg.com/320/100/any',
            content: '첫번째 게시글',
        },
    ],
    imagesPath: ['asdasd', 'asdasd','123123'],
    
}

    return (
        <div>
            { dummy.isLogged ? <div>{dummy.user}님이 로그인 하셨습니다</div> : <div>{dummy.user} 로그아웃 하셨습니다</div> }
        </div>
    )
}

export default Home;
